import axios from 'axios';

const PATIENT_API_BASE_URL = "http://localhost:8080/api/v1/users";

class PatientService {

    createPatient(patient) {
        return axios.post(PACIENT_API_BASE_URL, patient);
    }

    getPatientsOfDoctor(idDoctor) {
        return axios.get(PATIENT_API_BASE_URL + '/' + idDoctor);
    }

    deletePatient(patientId) {
        return axios.delete(PATIENT_API_BASE_URL + '/' + patientId);
    }

}
